import { useState, useEffect } from "react";

function ScheduleList(props) {
  console.log("child should have, ", props.schedules);
  return (
    <div>
      <h2>Schedules</h2>
      <h3>this is weird</h3>
      <ul>
        {props.schedules.map((schedule, index) => (
          <li key={index}>{schedule.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default ScheduleList;
